import React, { Component } from "react";
import './Home.css';

export default function Home() {
    componentDidMount()
    return (
        <div>
            <div id="carousel">
                <figure class="visible">
                    <img class="slideshow" src="./img/image1.jpeg" alt="img" />
                </figure>
                <figure class="hidden">
                    <img class="slideshow" src="./img/image4.jpg" alt="img" />
                </figure>
                <figure class="hidden">
                    <img class="slideshow" src="./img/image5.jpg" alt="img" />
                </figure>
            </div>

        </div>

    );
};
